import VueRouter from "vue-router";
import Vue from 'vue'
import AppView from '../views/element/teacherPage.vue'

Vue.use(VueRouter)

const routes = [
    {
        path: '/',
        name: 'home',
        component: AppView
    },
    {
        path: '/teacherPage',
        name: 'teacherPage',
        component: AppView
    },
    {
        path:'/questionPage',
        name:'questionPage',
        component:()=>import('../views/element/questionPage.vue')
    }
]


const router = new VueRouter({
    routes
})

export default router
